import React from 'react';
import classes from './WelcomeLogo.module.css';
import Aux from '../../../hoc/Aux/Aux';
import { Container, Row, Col } from 'react-bootstrap';

const welcomeLogo = (props) => (
  <Aux>
    <Container>
      <Row className={classes.Box}></Row>
      <Row className="justify-content-center"><h1>CASSANDRA</h1></Row>
      <Row style={{zindex:'100'}} className="justify-content-sm-center">
        <Col style={{textAlign:'center'}} xs lg="auto">INSTRUCTIONAL DESIGNER</Col>
        <Col style={{textAlign:'center'}} xs lg="auto"><span className={classes.Dot}></span></Col>
        <Col style={{textAlign:'center'}} xs lg="auto">TRAINER</Col>
        <Col style={{textAlign:'center'}} xs lg="auto"><span className={classes.Dot}></span></Col>
        <Col style={{textAlign:'center'}} xs lg="auto">TECHNICAL WRITER</Col>
      </Row>
    </Container>
  </Aux>
)

export default welcomeLogo;
